"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Diabetes insipidus (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/diabetes-insipidus-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H2987638\">",
"      <span class=\"h1\">",
"       What is diabetes insipidus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Diabetes insipidus is a condition that causes the body to make too much urine. This can happen when there are problems with a hormone called &ldquo;anti-diuretic hormone,&rdquo; which helps balance the amount of fluid in the body.",
"     </p>",
"     <p>",
"      There are 2 kinds of diabetes insipidus:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Central diabetes insipidus &mdash; In people with central diabetes insipidus, the body doesn&rsquo;t make enough anti-diuretic hormone to keep the amount of fluid in balance.",
"       </li>",
"       <li>",
"        Nephrogenic diabetes insipidus &mdash; In people with nephrogenic diabetes insipidus, the body makes enough anti-diuretic hormone, but the kidneys don&rsquo;t respond to it.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Diabetes insipidus is not the same as diabetes mellitus. Diabetes mellitus is a much more common disease that most people know simply as &ldquo;diabetes.&rdquo; Some of the symptoms, like urinating a lot, are the same. But otherwise, they are very different conditions. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987653\">",
"      <span class=\"h1\">",
"       What are the symptoms of diabetes insipidus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Needing to urinate often, sometimes in the middle of the night",
"       </li>",
"       <li>",
"        Making large amounts of urine",
"       </li>",
"       <li>",
"        Feeling very thirsty",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987668\">",
"      <span class=\"h1\">",
"       Is there a test for diabetes insipidus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor should be able to tell that you have the condition based on your symptoms. But in some cases, doctors will need to do tests. These might include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A test to measure how much urine your body makes. For this test, you stop drinking fluids for 2 to 3 hours. Then the doctor records how much urine you make over the next 2 hours and possibly longer.",
"       </li>",
"       <li>",
"        Tests to measure certain substances in your urine.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Plus, the doctor might give you a drug that&rsquo;s often used to treat the condition. Your body&rsquo;s response will help reveal which type of diabetes insipidus you have.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987683\">",
"      <span class=\"h1\">",
"       How is diabetes insipidus treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The right treatment for you will depend on what kind of diabetes insipidus you have. In general, all the treatments for diabetes insipidus work by reducing the amount of urine the body makes.",
"     </p>",
"     <p>",
"      If you have central diabetes insipidus, following a diet that&rsquo;s low in salt and protein might help control your symptoms. If diet changes don&rsquo;t help enough, your doctor might prescribe a medicine called",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?31/13/31957?source=see_link\">",
"       desmopressin",
"      </a>",
"      (brand names: DDAVP&reg;, Stimate&reg;). You can take this medicine as a nasal spray, a pill, or as a shot under the skin. This medicine replaces the anti-diuretic hormone missing from your body. Doctors sometimes prescribe other drugs as well. &nbsp;",
"     </p>",
"     <p>",
"      People who have nephrogenic diabetes insipidus have different treatment options. In this form of diabetes insipidus, the kidneys usually aren&rsquo;t responding to anti-diuretic hormone because they are damaged. Often, the kidney damage is caused by other health problems or the medicines people take to treat them. If possible, treating the other health problem or stopping the medicines can help. Doctors also might recommend a low-salt, low-protein diet. Plus, certain medicines, including some used to treat high blood pressure, might help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987698\">",
"      <span class=\"h1\">",
"       Are there warning signs I should watch for?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you are being treated for diabetes insipidus, see your doctor or nurse right away if have any of these symptoms:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Nausea",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Feeling very tired",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Having these symptoms could mean you need a different dose of the medicine you take to treat your diabetes insipidus.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987713\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some people feel better if they eat a diet that is low in sodium (the main ingredient in salt) and protein. These diet changes will help you make less urine.",
"     </p>",
"     <p>",
"      If you&rsquo;re not sure what to eat, talk to your doctor or nurse. He or she might refer you to a dietitian (food expert) who can help you choose what to eat.",
"     </p>",
"     <p>",
"      Another helpful tip is called &ldquo;double voiding.&rdquo; This involves urinating more than once to empty your bladder. After you urinate, wait 10 to 15 minutes, and then urinate again to empty your bladder completely.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987728\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most women with diabetes insipidus can have normal pregnancies. But be aware that diabetes insipidus can get worse during pregnancy.",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?31/13/31957?source=see_link\">",
"       Desmopressin",
"      </a>",
"      is safe for both mother and baby.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2987743\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?40/19/41266?source=see_link\">",
"       Patient information: Low-sodium diet (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?38/61/39890?source=see_link\">",
"       Patient information: Low sodium diet (Beyond the Basics)",
"      </a>",
"     </p>",
