" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 544px\">",
"   <div class=\"ttl\">",
"    Superficial cervical plexus block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 524px; height: 613px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A line is drawn from the mastoid process to the C6 transverse process (ie, Chassaignac's tubercle) along the posterior border of the sternocleidomastoid muscle (line shown in blue). The midpoint of this line is marked (red dot) and local anesthetic is injected, first raising a small skin wheal, followed by deeper injection of 10 to 15 mL along the posterior border of the sternocleidomastoid muscle with a \"fan technique\", two to three centimeters above and below the site of needle insertion.",
