"   <p>",
"    (For additional information",
"    <a class=\"drug drug_general\" href=\"mobipreview.htm?6/49/6932?source=see_link\">",
"     see \"Levocabastine (nasal): Drug information\"",
"    </a>",
"    )",
"   </p>",
"   <div class=\"list cbnlist drugH1Div drugBrandNames\" id=\"F11231185\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: Canada",
