var title_f42_55_43896="Life cycle of Onchocerca volvulus";
var content_f42_55_43896=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F66896&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F66896&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 631px\">",
"   <div class=\"ttl\">",
"    Life cycle of Onchocerca volvulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 611px; height: 492px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During a blood meal, an infected blackfly (genus Simulium) introduces third-stage filarial larvae onto the skin of the human host, where they penetrate into the bite wound",
"    <strong>",
"     (1)",
"    </strong>",
"    . In subcutaneous tissues the larvae",
"    <strong>",
"     (2)",
"    </strong>",
"    develop into adult filariae, which commonly reside in nodules in subcutaneous connective tissues",
"    <strong>",
"     (3)",
"    </strong>",
"    . Adults can live in the nodules for approximately 15 years. Some nodules may contain numerous male and female worms. Females measure 33 to 50 cm in length and 270 to 400 micron in diameter, while males measure 19 to 42 mm by 130 to 210 micron. In the subcutaneous nodules, the female worms are capable of producing microfilariae for approximately 9 years. The microfilariae, measuring 220 to 360 micron by 5 to 9 micron and unsheathed, have a life span that may reach 2 years. They are occasionally found in peripheral blood, urine, and sputum but are typically found in the skin and in the lymphatics of connective tissues",
"    <strong>",
"     (4)",
"    </strong>",
"    . A blackfly ingests the microfilariae during a blood meal",
"    <strong>",
"     (5)",
"    </strong>",
"    . After ingestion, the microfilariae migrate from the blackfly's midgut through the hemocoel to the thoracic muscles",
"    <strong>",
"     (6)",
"    </strong>",
"    . There the microfilariae develop into first-stage larvae",
"    <strong>",
"     (7)",
"    </strong>",
"    and subsequently into third-stage infective larvae",
"    <strong>",
"     (8)",
"    </strong>",
"    . The third-stage infective larvae migrate to the blackfly's proboscis",
"    <strong>",
"     (9)",
"    </strong>",
"    and can infect another human when the fly takes a blood meal",
"    <strong>",
"     (1)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Centers for Disease Control and Prevention. Available at:",
"     <a href=\"file://www.dpd.cdc.gov/dpdx/html/frames/a-f/filariasis/body_Filariasis_o_volvulus.htm\" target=\"_blank\">",
"      file://www.dpd.cdc.gov/dpdx/html/frames/a-f/filariasis/body_Filariasis_o_volvulus.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
